-- ----------------------------
-- Table structure for UK_SYSTEM_MESSAGE
-- ----------------------------
DROP TABLE "SYSTEM"."UK_SYSTEM_MESSAGE";
CREATE TABLE "SYSTEM"."UK_SYSTEM_MESSAGE" (
  "ID" VARCHAR2(32 CHAR) ,
  "MSGTYPE" VARCHAR2(20 CHAR) ,
  "SMTPSERVER" VARCHAR2(255 CHAR) ,
  "SMTPUSER" VARCHAR2(255 CHAR) ,
  "SMTPPASSWORD" VARCHAR2(255 CHAR) ,
  "MAILFROM" VARCHAR2(255 CHAR) ,
  "SECLEV" VARCHAR2(50 CHAR) ,
  "SSLPORT" VARCHAR2(50 CHAR) ,
  "ORGI" VARCHAR2(32 CHAR) ,
  "URL" VARCHAR2(255 CHAR) ,
  "SMSTYPE" VARCHAR2(32 CHAR) ,
  "APPKEY" VARCHAR2(200 CHAR) ,
  "APPSEC" VARCHAR2(200 CHAR) ,
  "SIGN" VARCHAR2(50 CHAR) ,
  "TPCODE" VARCHAR2(50 CHAR) ,
  "CREATETIME" DATE ,
  "NAME" VARCHAR2(50 CHAR) ,
  "MOREPARAM" CLOB 
)
TABLESPACE "SYSTEM"
LOGGING
NOCOMPRESS
PCTFREE 10
INITRANS 1
STORAGE (
  INITIAL 65536 
  NEXT 1048576 
  MINEXTENTS 1
  MAXEXTENTS 2147483645
  FREELISTS 1
  FREELIST GROUPS 1
  BUFFER_POOL DEFAULT
)
PARALLEL 1
NOCACHE
DISABLE ROW MOVEMENT
;
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."ID" IS '主键ID';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."MSGTYPE" IS '消息类型';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."SMTPSERVER" IS 'SMTP服务器';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."SMTPUSER" IS 'SMTP账号';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."SMTPPASSWORD" IS 'SMTP密码';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."MAILFROM" IS '发件人';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."SECLEV" IS '启用SSL';
COMMENT ON COLUMN "SYSTEM"."UK_SYSTEM_MESSAGE"."SSLPORT" IS 'SSL端口';
