INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106ae70161', '数据表', NULL, 'report', NULL, TO_TIMESTAMP('2018-02-14 09:18:43.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '<#if reportData??>
<table class="layui-table ukefu-report">
  <thead>
	<#if reportData?? && reportData.col?? && reportData.col.title??>
	  <#list reportData.col.title as tlist>
		<tr class="sortableTr">
		  <#if reportData.col.title?size gt 1 && tlist_index==0 && reportData.row.title?size gt 0>
			<td align="center" colspan="${reportData.row.title?size}" rowspan="${reportData.col.title?size-1}" class="s_blue"></td>
		  </#if>
		  <#if (tlist_index+1)==reportData.col.title?size && reportData.row?? && reportData.row.firstTitle??>
			<#list reportData.row.firstTitle as first>
			  <td align="center" data-title="${first.name?url}" data-flag="dim">${first.rename!first.name!''''}				
			</#list>
		  </#if>
		  <#if tlist??>
			<#list tlist as tl>
			  <td align="center" <#if tl.leveltype?? && tl.leveltype=="newcol">rowspan="${reportData.col.title?size}"</#if>colspan="${tl.colspan}" > ${tl.rename!tl.name!""}
				</td>
			</#list>
			</#if>
	</tr>
	</#list>
	</#if>
  </thead>
  <tbody>
	<#if reportData?? && reportData.data??>
	  <#list reportData.data as values>
		<tr class="rowcell">
		  <#if reportData.row?? && reportData.row.title?? && reportData.row.title?size gt 0>
			<#list reportData.row.title as tl>
			  <#assign rows=0>
				<#list tl as title>
				  <#if title??>
					<#if rows==values_index && title.name !="TOTAL_TEMP">
					  	<#if title.leveltype !="newrow_extend_sum">
						<td nowrap="nowrap" align="center" class="blue_k <#if title.total == true>total</#if>" rowspan="${title.rowspan!''0''}" <#if title.colspan gt 1>colspan="${title.colspan}"</#if>>
						  ${title.formatName!''''}</td>
						</#if>
						<#if title.valueData??>
						  <#list title.valueData as value>
							<#if value.merge==false>
							  <td rowspan="${value.rowspan}" colspan="${value.colspan}" align="center" class="measure ${value.vtclass!''''}" nowrap="nowrap" <#if value.cellmergeid??>data-cellmerge="${value.cellmergeid}"</#if>>
							${value.valueStyle!value.foramatValue!''''}</td>
							</#if>
							</#list>
						  </#if>
					  </#if>
					  <#assign rows=rows + title.rowspan>
				  </#if>
			</#list>
	</#list>
	<#else>
	  <#list values as value>
		<td class="row " style="text-align: right;<#if value.valueType?? && value.valueType == ''total''>background-color:#c5daed;</#if>">
		  ${value.valueStyle!value.foramatValue!''''}</td>
	  </#list>
	  </#if>
	  </tr>
	  </#list>
	  </#if>
  </tbody>
</table>
<#if reportModel?? && reportModel.isloadfulldata == ''true''>
<#if reportData?? && reportData.total gt reportData.pageSize>
<div class="row" style="padding:5px;">
	<div class="col-lg-12" id="page_${reportModel.id!''''}" style="text-align:center;"></div>
</div>
</#if>
<script>
	layui.use([''laypage'', ''layer'',''form''], function(){
		  var laypage = layui.laypage
		  ,layer = layui.layer;
		  laypage.render({
			  elem:''page_${reportModel.id!''''}''
				,count: <#if reportData??>${reportData.total}<#else>0</#if> 
				,curr:<#if reportData??>${reportData.page}<#else>0</#if>
				,groups: 5 
				,limit:<#if reportData?? && reportData.pageSize gt 0>${reportData.pageSize}<#else>20</#if>
				,jump:function(data , first){
					if(!first){
						loadURL("/apps/report/design/getelement.html?id=<#if reportModel??>${reportModel.id!''''}</#if>&p="+data.curr,"#${reportModel.id!''''}");
					}
				}
		   });
		});
</script>
</#if>
<#else>
<div class="layui-form">
  <table class="layui-table">
    <thead>
      <tr><th>标题一</th><th>标题二</th><th>标题三</th></tr> 
    </thead>
    <tbody>
      <tr><td>样例数据</td><td>样例数据</td><td>样例数据</td>
      </tr>
      <tr><td>样例数据</td><td>样例数据</td><td>样例数据</td></tr>
      <tr><td>样例数据</td><td>样例数据</td><td>样例数据</td></tr>
    </tbody>
  </table>
</div>
</#if>', '4028811b618d0dca01618d5a5fe6034a', 'ukewo', '/images/design/table.png', NULL, NULL, NULL, NULL, '0', 'simple', NULL);
INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106aea0162', '金字塔图', NULL, 'report', NULL, TO_TIMESTAMP('2018-02-14 09:21:57.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '	<script>
