', '4028811b618d0dca01618d5a5fe6034a', 'ukewo', '/images/design/jzt.png', NULL, NULL, NULL, NULL, '0', NULL, 'pyramid');
INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106aed0163', '地图', NULL, 'report', NULL, TO_TIMESTAMP('2018-02-14 09:22:21.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '	<script>
	<#if reportData??>
	var data_${element.mid!''''} = [];
	<#if reportData.row??>
		<#list reportData.row.title as title>
			<#if (title_index+1) == reportData.row.title?size>
				<#list title as rowtl>	
					var obj_${element.mid!''''} = new Object();
					obj_${element.mid!''''}["key"] = ''${rowtl.rename!rowtl.name!''''}'';
					<#if reportData.col??>
						<#list reportData.col.title as coltlist>
							<#list coltlist as coltl>
								<#if coltl_index == 0>	
									<#list reportData.data as values>
										<#if rowtl_index == values_index>
											<#list values as val>	
												<#if coltl_index == 0>
													obj_${element.mid!''''}["value"] = ${val.valueStyle!val.foramatValue!''''}
												</#if>
											</#list>
										</#if>
									</#list>									
								</#if>																			
							</#list>
						</#list>
					</#if>	
					data_${element.mid!''''}.push(obj_${element.mid!''''});		
				</#list>										
			</#if>
		</#list>
	</#if>		
	</#if>	
	let func_${element.mid!''''} = function(geoJson){
	<#if !reportData??>
		const data1_${element.mid!''''} = [];
		  for (let i = 0; i < geoJson.length; i++) {
	  	      let name = geoJson[i].properties.name;
	  	      data1_${element.mid!''''}.push({
	  	        key: name,
	  	        value: Math.round(Math.random() * 1000),
	  	      });
	  	    }
	<#else>
		const data1_${element.mid!''''} = [];
		for (let i = 0; i < geoJson.length; i++) {
			let name = geoJson[i].properties.name;
			let value = 0;
			for (let j = 0; j < data_${element.mid!''''}.length;j++) {				  	      
			  let name2 = data_${element.mid!''''}[j]["key"];
			  if(name == name2){
				value = data_${element.mid!''''}[j].value;
			  }	      
	  	    }
			data1_${element.mid!''''}.push({
	  	        key: name,
	  	        value: value,
	  	      });
	  	    }
	</#if>
	
		let mapData_${element.mid!''''} = {
	      type: ''FeatureCollection'',
	      features: geoJson
		};
	    let ds_${element.mid!''''} = new DataSet();
	    let geoDataView_${element.mid!''''} = ds_${element.mid!''''}.createView().source(mapData_${element.mid!''''}, {
	      type: ''GeoJSON'',
	    });

	    // 用户数据
	    let dvData_${element.mid!''''} = ds_${element.mid!''''}.createView().source(data1_${element.mid!''''});
	    dvData_${element.mid!''''}.transform({
	      type: ''geo.region'',
	      field: ''key'',
	      geoDataView: geoDataView_${element.mid!''''},
	      as: [''longitude'', ''lantitude''],
	    });
	   var json_${element.mid!''''} =  $.parseJSON( $("#json_${element.mid!''''}").text() );
	  $("#json_${element.mid!''''}").remove();
