INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106b0d016c', '雷达图', NULL, 'report', NULL, TO_TIMESTAMP('2018-02-14 09:28:54.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '	<script>
