INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106b2c0177', '组织机构', NULL, 'organ', NULL, TO_TIMESTAMP('2018-08-22 12:10:54.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '<div class="layui-form-item">
	<div class="layui-inline"> 
		<div class="layui-input-inline" style="position: relative;">
			<input type="hidden" name="${filter.code!''''}"  id="${filter.code!''''}" value="">
			<input type="text" name="${filter.code!''''}_name"  id="${filter.code!''''}_name" required value="" lay-verify="required" autocomplete="off" readOnly="readonly" onClick="showMenu();"
				class="layui-input">
			<i class="layui-icon" style="position: absolute;right: 3px;top: 6px;font-size: 25px;${systemConfig.color!''color:#0096C4;''}" onClick="showMenu()">&#xe631;</i>
			<div id="menuContent" style="display:none; position: absolute;z-index:10000;" class="ukefu-ztree">
				<ul id="${filter.code!''''}_Tree" class="ztree" style="width:208px;"></ul>
			</div>
		</div>
	</div>
</div>
<SCRIPT type="text/javascript">
	var setting = {
		data: {
			simpleData: {
				enable: true
			}
		},
		callback: {
			onClick: onClick,
			beforeClick: beforeClick
		}
	};
	
	function beforeClick(treeId, treeNode) {
		var zTree = $.fn.zTree.getZTreeObj("${filter.code!''''}_Tree")
		nodes = zTree.getSelectedNodes();
		var allow = true , lastnode ;
		for (var i=0, l=nodes.length; i<l; i++) {
			lastnode = nodes[i].type ;
			if(nodes[i].organ && (nodes.length >= 1 && (event.ctrlKey || event.shiftKey))){
				allow = false ; break ;
			}
		}
		if(lastnode != treeNode.type && (event.ctrlKey || event.shiftKey)){
			allow = false ;
		}
		
		if (allow == false) {
			top.layer.alert("组织机构不能点选多个上级机构，也不能同时选择地区和机构", {icon: 3});
			return false;
		} else {
			return true;
			
		}
	}
	function onClick(e, treeId, treeNode) {
		var zTree = $.fn.zTree.getZTreeObj("${filter.code!''''}_Tree"),
		nodes = zTree.getSelectedNodes(),
		v = "" , value = "";
		nodes.sort(function compare(a,b){return a.id-b.id;});
		for (var i=0, l=nodes.length; i<l; i++) {
			v += nodes[i].name + "";
			if(value != ""){
				value = value + "," ;
			}
			value = nodes[i].id ;
		}
		$("#${filter.code!''''}_name").attr("value", v);
		$("#${filter.code!''''}").attr("value", value);
		if (!event.ctrlKey && !event.shiftKey) {
			hideMenu() ;
		}
	}

	var zNodes =[
	    { id:''0'', pId:''00'', name:"${filter.name!''''}", open:true , organ : true, type : "organ"}
	    <#if organList??>
	    <#list organList as organ>
	    ,{ id:''${organ.id!''''}'', pId:''${organ.parent!''0''}'', name:"${organ.name!''''}", open:true , organ : true , type : "organ",  icon:"/images/dept.png" }
	    </#list>
	    </#if>
	];
	$(document).ready(function(){
		var ztree = $.fn.zTree.init($("#${filter.code!''''}_Tree"), setting, zNodes);
		<#if organ??>
		var node = ztree.getNodeByParam(''id'', ''${organ.id!''''}'');//获取id为1的点
		ztree.selectNode(node);//选择点  
		</#if>
	 
	});
	function showMenu() {
		$("#menuContent").css({left:"0px", top:"38px"}).show();

		$("body").bind("mousedown", onBodyDown);
	}
	function hideMenu() {
		$("#menuContent").hide();
		$("body").unbind("mousedown", onBodyDown);
	}
	function onBodyDown(event) {
		if (!(event.target.id == "menuBtn" || event.target.id == "menuContent" || $(event.target).parents("#menuContent").length>0)) {
			hideMenu();
		}
	}
</SCRIPT>', '4028811b618d0dca01618d5a5ff6034b', 'ukewo', '/images/design/select.png', NULL, NULL, NULL, NULL, '0', NULL, NULL);
