INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106b320179', 'BotQuery', NULL, 'BotQuery', NULL, TO_TIMESTAMP('2019-01-02 18:02:59.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '{
