INSERT INTO "SYSTEM"."UK_TEMPLET" VALUES ('402880ee68abd1a50168ac106b37017b', '报表XML模板', NULL, 'reportquery', NULL, TO_TIMESTAMP('2018-02-28 11:28:53.000000', 'SYYYY-MM-DD HH24:MI:SS:FF6'), NULL, NULL, '<?xml version=''1.0'' ?>
<Schema name=''ukefu''>
    <#if !cube.modeltype?? || cube.modeltype!="1">
    <Cube name=''${cube.name}''>
		<#if cube.sql?? && cube.sql?length gt 0>
		<View alias=''${cube.table}''>
                        <SQL>                              
							${(cube.sql!'''')?html}
                        </SQL>
                </View>
		<#else>
		<Table name=''${cube.table}'' />
                </#if>
		
		<#if reportModel.properties?? && reportModel.properties?size gt 0 >
			<Dimension name=''${reportModel.name}''>
				<Hierarchy hasAll=''true'' allMemberName=''''>						
					<#list reportModel.properties as property>
						<#list cube.dimension as dimension>
							<#list dimension.cubeLevel as level>
							<#if property.dataid == level.id>
							<Level name=''${level.name}''  column=''<#if dimension.fktable?? && dimension.fktable!= "">${level.tableproperty.key}<#else>${level.nameAlias}</#if>'' uniqueMembers=''${level.uniquemembers?string}''  <#if level.parameters??>${level.parameters!""}</#if>>
								<#if level.attribue?? && level.attribue?length gt 0>${level.attribue!""}</#if>
								</Level>	
							</#if>						
							</#list>	
						</#list>					
					</#list>			
				</Hierarchy>
			</Dimension>        
		</#if>
		<#if istable?? && istable && reportModel.colproperties?? && reportModel.colproperties?size gt 0>
			<Dimension name=''${reportModel.name}_col''>
				<Hierarchy hasAll=''true'' allMemberName=''''>
					<#if reportModel.colproperties??>
					<#list reportModel.colproperties as property>
						<#list cube.dimension as dimension>
							<#list dimension.cubeLevel as level>
							<#if property.dataid == level.id>
							<Level name=''${level.name}''  column=''<#if dimension.fktable?? && dimension.fktable!= "">${level.tableproperty.key}<#else>${level.nameAlias}</#if>'' uniqueMembers=''${level.uniquemembers?string}''  <#if level.parameters??>${level.parameters!""}</#if>>
								<#if level.attribue?? && level.attribue?length gt 0>${level.attribue!""}</#if>
								</Level>	
							</#if>						
							</#list>	
						</#list>					
					</#list>
					</#if>
				</Hierarchy>
			</Dimension>
		</#if>

		<#if cube.measure??>
			<#list cube.measure as measure>				
				<#if measure.calculatedmember != true>
				<Measure name=''${measure.name}'' <#if measure.attribue?? && measure.attribue?length gt 0><#else>column=''${measure.nameAlias}''</#if> aggregator=''${measure.aggregator}'' <#if measure.formatstring != ''''>formatString=''${measure.formatstring!"####"}''<#else>formatString=''####''</#if>>
						<#if measure.attribue?? && measure.attribue?length gt 0>
						${measure.attribue!""}
						</#if>
				</Measure>
				</#if>
			</#list>
        </#if>
		

		<#if cube.measure??>
			<#list cube.measure as measure>				
				<#if measure.calculatedmember == true>
					<CalculatedMember name=''${measure.name}'' dimension=''Measures'' <#if measure.parameters??>${measure.parameters!""}</#if> <#if measure.formatstring?? && measure.formatstring?length gt 0>formatString="${measure.formatstring!""}"</#if>>
                             <#if measure.attribue?? && measure.attribue?length gt 0>${measure.attribue!""}</#if>
                        </CalculatedMember>
				</#if>
			</#list>
		</#if>

		</Cube>	
	</#if>
</Schema>', '402881e861da4c960161da7040bc0385', 'ukewo', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL);
